class BootScene extends Phaser.Scene {
    constructor() {
        super('BootScene');

        // Questa stringa base64 rappresenta un'immagine pixel art semplice (un quadrato verde)
        // La useremo come placeholder per lo sfondo della mappa.
        // È di 128x128 pixel, un buon punto di partenza per la pixel art.
this.base64MapImage = 'data:image/png;base64,'
    }
    preload() {
        const loadingText = this.add.text(
            this.cameras.main.width / 2,
            this.cameras.main.height / 2,
            'Caricamento...',
            {
                fontSize: '32px',
                fill: '#ffffff'
            }
        ).setOrigin(0.5);

        this.load.on('complete', () => {
            console.log('Caricamento asset completato. Avvio MapScene...');
            this.scene.start('MapScene');
        });
    }

    create() {
        // Non c'è molto da fare qui
    }
}
// Non usiamo più "export default BootScene;"
